export function PerfilUsuario({Perfil}) {
  return (
    <><div className='container'></div>
        <div className='container mx-auto flex justify-center'>
          <div><img src={Perfil.url_imagen} alt='Imagen de perfil' className='rounded-full mt-2 mb-2 hover:bg-fuchsia-600'/><p className='justify-self-center'>pp</p></div>
          
        </div>
    </>
  )
}
